    false,nt"url": null,nt"notes": "This narrative report for Valentine NWR
    outlines Refuge accomplishments from November, 1939 through January, 1940. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and wildfires.
    Resource management is outlined; topics include grazing and fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes Refuge visitors and hunting.",nt"license_title":
